column8:
ベトつかず、少量でスッっとのびる。<br><br> 毎日のお手入れに、つけ心地の良い「自然派保湿美容液ココメロ」と相性の良い自然派保湿クリームです。<br><br>
＜製品紹介＞ 石油系合成界面活性剤、香料、着色料、鉱物油、パラベンは一切使用しておりません。<br><br>
 オリジナル成分である大豆・米ぬか醗酵液《コスモバック》を贅沢に配合いたしました。<br><br>
 皮脂と水分のバランスをコントロールし、肌本来の機能を正常化へと導きます。<br><br>
 べとつきがなくさっぱりしたつけ心地。肌への親和性に優れており厚塗りする必要がないので、肌への負担がかかりません。<br><br>
 ネッククリームとして首までのご使用もお勧めします。<br><br>
 ＜「保湿」の総仕上げにオススメです＞ ココメロで保湿してあげても、少し保湿が物足りない方向けにご用意しました。<br><br>ココメロ専用の保湿クリームでしっかり膜をつくり乾燥を防いであげましょう。<!--

